#include<bits/stdc++.h> 
using namespace std; 
#define MAX 100007
#define MAXN 100007
#define mod 1000000007
int depth[MAX];
int parent[MAX];    
int spf[MAX]; 
unordered_set<int>un;
unordered_map<int,int>mp;
unordered_map<int,int>cn;
unordered_map<int,int>ac;
vector < int > adj[MAX]; 
vector < int > vec; 
void sieve() 
{ 
    spf[1] = 1; 
    for (int i=2; i<MAXN; i++) 

        spf[i] = i; 

    for (int i=4; i<MAXN; i+=2) 
        spf[i] = 2; 

    for (int i=3; i*i<MAXN; i++) 
    { 
        if (spf[i] == i) 
        { 
            for (int j=i*i; j<MAXN; j+=i) 

                if (spf[j]==j) 
                    spf[j] = i; 
        } 
    } 
} 

void addEdge(int u,int v) 
{ 
    adj[u].push_back(v); 
    adj[v].push_back(u); 
} 

void dfs(int cur, int prev) 
{ 

    parent[cur] = prev; 


    depth[cur] = depth[prev] + 1; 
    for (int i=0; i<adj[cur].size(); i++) 
        if (adj[cur][i] != prev) 
            dfs(adj[cur][i],cur); 
} 

void preprocess() 
{
    depth[0] = -1; 

    dfs(1,0); 
} 
int LCANaive(int u,int v) 
{ 

    if (u == v){
        if(ac[u]==0){
vec.push_back(u);
ac[u]++;
}

 return u; 
    }
           if(ac[u]==0){
vec.push_back(u);
ac[u]++;
}
           if(ac[v]==0){
vec.push_back(v);
ac[v]++;
}
   if (depth[u] > depth[v]) 
        swap(u, v); 
    v = parent[v]; 
    return LCANaive(u,v); 
} 
void getFactorization(int x) 
{ 
    while (x != 1) 
    {  
       un.insert(spf[x]);
        mp[spf[x]]++;
        x = x / spf[x]; 
    } 

} 
int main() 
{   
    int t;
    cin>>t;
    sieve(); 
    while(t--){
    int b,c,i,j,k,m,n,x,y,w,u,v,q,r,mn=-1;
    long long int l,s=1;
    cin>>n;
    mn=max(mn,n);
    int a[n];
    for(i=0;i<=mn;i++){
    adj[i].clear();
   } 
    cn.clear();
    for(i=0;i<=mn;i++){
        depth[i]=0;
        parent[i]=0;
    }
for(i=0;i<(n-1);i++){
    cin>>x>>y;
    addEdge(x,y);
}
    for(i=0;i<n;i++){
        cin>>a[i];
        w=i+1;
        cn[w]=a[i];
    }

    preprocess(); 
    cin>>q;
for(int p=0;p<q;p++){
    s=1;
    cin>>b>>c;
    vec.clear();
    mp.clear();
    un.clear();
    ac.clear();
m=LCANaive(b,c);
for(i=0;i<vec.size();i++){
    r=cn[vec[i]];

     getFactorization(r);
}

for(auto o:un){

    l=(mp[o]+1)%mod;
    s=(s*l)%mod;

}
cout<<s<<"\n";
}
}
}
